import { Component } from 'react';
import { connect } from 'react-redux';

// import {goForward, goBack} from '../../../actions/page';


import Page1 from './pages/page1';
import Page2 from './pages/page2';
import Page3 from './pages/page3';
import Page4 from './pages/page4';
import Page5 from './pages/page5';
import Page6 from './pages/page6';
import Page7 from './pages/page7';
import Page8 from './pages/page8';
import Page9 from './pages/page9';
import Page10 from './pages/page10';
import Page11 from './pages/page11';
import Page12 from './pages/page12';
import Page13 from './pages/page13';

// import larrow from "../pictures/larrow.png";
// import rarrow from "../pictures/rarrow.png";
import './script2.css';
import './script2iPad.css';
import './script2iPadPro.css';


class Script2List extends Component {

    state = {
      component_list: [<Page1 />, <Page2/>, <Page3 />, <Page4/>, <Page5 />, <Page6/>, <Page7 />, <Page8/>, <Page9 />, <Page10 />, <Page11 />, <Page12 />, <Page13 />]
  }
    
    
    render() {
      return(
      <div>{this.state.component_list[this.props.pageNum-1]}</div>
      )
    }
  }

const mapStateToProps = (state) => {
  return {
    pageNum: state.pages.pageNumber,
    texts: state.texts
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    goForward: () => dispatch(goForward()),
    goBack: () => dispatch(goBack())
  }
}


export default connect(mapStateToProps, mapDispatchToProps)(Script2List);
